import React from 'react'
import './home.css'
function go() {
  var hash = localStorage.getItem("hash")
  if (hash !== null) {
    window.location = '/admin'
  }
}

class Users extends React.Component {
  render() {
    return <div>
      <h1>Welcome, User!</h1>
      <h2>Commands</h2>
      <img id="firstlc" src="https://cdn2.iconfinder.com/data/icons/font-awesome/1792/terminal-512.png" alt="Commands" height="50" onClick={go} />
    </div>
  }
}
export default Users
